INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1001, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 0, 0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, "お！\nあそこに困ってそうな人発見！", 2, "春咲 ひより");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1002, "みんなみたいに\nわたしも強くならなきゃ", 1, 0, 0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, "大切な人を\n守れるようになりたい…って", 2, "草野 優衣");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1003, "フェンシングを始めてみては？", 1, 0, 0, 0, "少しは磨かれると思いますよ。", 1, "キミに必要な集中力と感性が", 2, "士条 怜");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.5, 0, 1004, "ねぇ、にいちゃん！", 1, 0, 0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 1, "今日はなにして遊ぶ？", 2, "穂高 みそぎ");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1006, "風宮あかりです", 1, 0, 0, 0, "私といっしょに…\nいかない？", 1, "ねぇ…", 2, "風宮 あかり");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.5, 0, 1007, "出雲宮子なのー", 1, 0, 0, 0, "食べ物の恨みは怖いのー", 1, "プリンたべたいのー", 2, "出雲 宮子");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1008, "ボクは虹村雪。", 1, 0, 0, 0, "いいよ。\n見られることは運命さ…", 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 2, "虹村 雪");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1009, "フッ…聞いて後悔するがいい！", 1, 0, 0, 0, "人呼んで「疾風の冥姫」!!", 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, "柊杏奈");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.5, 0, 1010, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 0, 0, 0, "ほんまおおきにやわ～♪", 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, "姫宮 真歩");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1011, "衣之咲璃乃です！", 1, 0, 0, 0, "ここで会ったが\n100年目～！", 1, "生き別れたお兄ちゃんを探して\n三千世界！", 2, "衣之咲 璃乃");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1012, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 0, 0, 0, "…って、お願い！\n誰にも言わないでおいて～！", 1, "ち、超能力って…\n何のことかな～？", 2, "柏崎 初音");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1016, "ちょす！\n美波鈴奈だよ～♪", 1, 0, 0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, "一応カリスマ読モJKやってまっす！", 2, "美波 鈴奈");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1017, "はいたーい。\n喜屋武香織さー。", 1, 0, 0, 0, "でも、沖縄もとってもいいとこさー", 1, "東京は遊園地みたいなところさー", 2, "喜屋武 香織");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1018, "支倉伊緒です。", 1, 0, 0, 0, "イオちゃんって呼んでね。", 1, "先生って呼ばれるのは\nくすぐったいから", 2, "支倉 伊緒");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.5, 0, 1020, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 0, 0, 0, "ミミをおいてかないでぇ～", 1, "あ！/\お兄ちゃ～ん\nまってよ～", 2, "茜 ミミ");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.5, 0, 1021, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 0, 0, 0, "ふぇぇぇぇぇん……", 1, "あの……\nふぇ……", 2, "栗林 くるみ");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1022, "風宮よりです。\nあああああ！", 1, 0, 0, 0, "なんてありがとうございます！", 1, "こんな私に貴重な時間を\n割いていただき、", 2, "風宮 より");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.5, 0, 1023, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 0, 0, 0, "私こっち行きたいー\nね、早く早くー", 1, "おにいちゃんどこいくの？\nえ？", 2, "北条 綾音");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1025, "わっ…わっ…私、\n天野すずめといいます！", 1, 0, 0, 0, "これて何か違う…\nあああすみません！", 1, "ふ、不束者ですが\nどうぞ末永く…って、", 2, "天野 すずめ");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1027, "……クスクス…私は\n…倉石恵理子……", 1, 0, 0, 0, "離しませんわ………\n絶対に…!!", 1, "あなたは…運命の……\n伴侶……", 2, "倉石 恵理子");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1028, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 0, 0, 0, "…そうでしょ？？", 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, "佐々木 咲恋");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1029, "桜井望だよ！\nよろしくねっ", 1, 0, 0, 0, "あはは、\n私もまだまだだなぁ～", 1, "ぇっと…\nキミ、私のこと知らないの?!", 2, "桜井 望");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1030, "デケデケデンっ！", 1, 0, 0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 1, "初めまして、\n私はニノン・ジュベール申すデス！", 2, "ニノン・ジュベール");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1031, "上喜しのぶです。\n手元のドクロが父です。", 1, 0, 0, 0, "おかしいですね……", 1, "でもって私の隣にいるのが……\nえ、見えない？", 2, "上喜 しのぶ");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.5, 0, 1033, "目指すはビッグな\nお笑い芸人だっぺ！", 1, 0, 0, 0, "そう、\nオラのボケに突っ込める相方が…！", 1, "けんども\nそれには足りないモンが…", 2, "野戸まひる");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1034, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 0, 0, 0, "ちょ\nちょっと一杯飲んできます…！", 1, "ちょっと緊張しちゃって…", 2, "綾瀬 ゆかり");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.5, 0, 1036, "氷川鏡華…です", 1, 0, 0, 0, "これ以上お話しすることは…\nないです！", 1, "知らない人とは話しちゃいけないので", 2, "氷川 鏡華");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1038, "柏崎…栞です。", 1, 0, 0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, "……あ、アラーム。", 2, "柏崎 栞");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1040, "ふ、双葉碧です。", 1, 0, 0, 0, "野に咲く花が、\n唯一の話相手です。", 1, "私、一人も友達がいなくて……", 2, "双葉 碧");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1042, "三角千歌です。", 1, 0, 0, 0, "そう思っています。", 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, "三角 千歌");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1043, "安芸真琴だ。", 1, 0, 0, 0, "う、疑ってすまなかったな…", 1, "あぁ？\nお前のそいつの仲間か？", 2, "安芸 真琴");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1044, "わらわこそは夜を総べる者！", 1, 0, 0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, "生けとし生ける全ての者よ！", 2, "イリヤ・オーンスタイン");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1045, "そこで騎士は妖精を乱暴に……", 1, 0, 0, 0, "ｌク、クウカに何かご用ですか!?", 1, "ぐふふふふ……はっ！", 2, "遠見 空花");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1046, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 0, 0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, "宮坂たまき");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1048, "大神美冬よ！", 1, 0, 0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, "それでは早速クエストに…", 2, "大神 美冬");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1049, "星野静流だよ！", 1, 0, 0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, "クエストもバトルも\n掃除も洗濯も", 2, "星野静流");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.5, 0, 1050, "アタシは玉泉美咲。", 1, 0, 0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, "見ての通りの\nセクシー美少女で", 2, "玉泉美咲");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.4, 0, 1052, "？？？", 1, 0, 0, 0, "？？？？", 1, "？？？？", 2, "リマ");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.5, 0, 1053, "モニカ・ヴァイスヴィントだ。", 1, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", 1, "菓子でつろうなどと\n稚拙な策を……", 2, "モニカ・ヴァイスヴィント");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.5, 0, 1058, "モニカ・ヴァイスヴィントだ。", 1, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", 1, "菓子でつろうなどと\n稚拙な策を……", 2, "ペコリーヌ");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.5, 0, 1059, "モニカ・ヴァイスヴィントだ。", 1, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", 1, "菓子でつろうなどと\n稚拙な策を……", 2, "コッコロ");
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 1.5, 0, 1060, "モニカ・ヴァイスヴィントだ。", 1, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", 1, "菓子でつろうなどと\n稚拙な策を……", 2, "キャル");
